        protected override void Finish()
        {
            ulong processed_blocks = (m_processed_bytes / (uint)BlockSize) + 1;
            int padindex = BlockSize - m_buffer.Pos - 8;

            if (m_buffer.Pos > BlockSize - 8 - 1)
